<script>
		window.Parsley.addValidator('notEqualTo', {
			validateString: function(value, requirement) {
			 return $('#'+requirement).val() != value;
			}
		}).addValidator('complexPassword', {
			validateString: function(value) {
			var numPat = /\d/;
			var upperPat = /[A-Z]/;
			var lowerPat = /[a-z]/;
			var specialPat = /[^0-9a-zA-Z]/;
			 return numPat.test(value) && upperPat.test(value) && lowerPat.test(value) && specialPat.test(value);
			},
			messages: {
				en: 'Password should contain at least :<br>'+
				'1 Uppercase Character<br>'+
				'1 Lowercase Character<br>'+
				'1 Numeric Character<br>'+
				'1 Special Character<br>',
			}
		}).addValidator('fqdn', {
			validateString: function(value) {
			var httpPat = /http/;
			var slashPat = /[\/]/;
			 return (httpPat.test(value) || slashPat.test(value)) == false;
			},
			messages: {
				en: 'FQDN should not contain the http:// or any /',
			}
		});
